    "roadmap": {
      "mission_roadmap": "Mise a plán rozvoje",
      "integrated_call_system": "Plně integrované Call Centrum",
      "integrated_call_system_msg": "Po hurikánu Harvey a Irma, obdrželo naše virtuální call centrum více než 60.000 hovorů. Ale rozhraní vytvořené pro školení, komunikaci a řízení dobrovolníků mělo problémy. Navrhli jsme přepracování call centra v aplikaci, aby bylo snadnější použití a bylo jednodušší trénovat dobrovolníky. Tato aktualizace umožní jakémukoliv dobrovolníkovi, kdekoli být součástí call centra.",
      "send_feedback": "Poslat zpětnou vazbu",
      "multi_lingual_support": "Robustní podpora více jazyků",
      "multi_lingual_support_msg": "Katastrofy neznají hranice, a zároveň dělají Crisis Cleanup populární. Snažíme se podporovat úsilí o obnovu v Mexico City, Puerto Rico, a mezi španělsky mluvící populací v Texasu a na Floridě.",
      "crew_equipment_management": "Řízení posádek a těžké techniky",
      "crew_equipment_management_msg": "Vědět, kdo potřebuje pomoc, je jen část bitvy. Máme v plánu řízení priorit pracovních požadavků, sledování dobrovolníků, dobrovolnických hodin, a zařízení. Tyto funkce budou mít dramatický dopad na schopnost dobrovolnických manažerů efektivně řídit a sledovat dobrovolníky.",
      "crew_equipment_management_msg2": "Budujeme základy k poskytnutí real-time dobrovolníků v mapování a jedinečných terénních pracovníků, jako jsou řidiči těžké techniky, nebo lidé se speciálním výcvikem. To umožní krizové řízení s cílem maximalizovat úsilí záchranářů a kompenzovat je finančními prostředky.",
      "critical_needs": "Vylepšení rozlišení kritických potřeb",
      "critical_needs_msg": "Zkušenosti ukázaly, že první lidé kteří požádají o pomoc, často nejsou lidé, kteří pomoc nejvíce potřebují. Chceme přidat vrstvy sociálního indexu ohrožení a pokročilé real-time filtrování mapy.  Poskytnout humanitárním organizacím větší pravomoc nasměrovat jejich energie do oblastí, které by jinak trpěly.",
      "survivor_advocacy": "Nástroje pro ochranu přeživších",
      "urgent_needs": "Naléhavé potřeby",
      "urgent_needs_msg": "Občas dobrovolníci našeho partnera mluví s někým, kdo potřebuje <em>okamžitou pomoc</Em> Chceme zlepšit možnost pro každého, kdo se chce v decentralizované síti Crisis Cleanup obrátit na místní dobrovolníky a hledat ochranu jako přeživší. ",
      "hero_stories": "Sociální Nástroje integrace (Příběhy hrdinů)",
      "hero_stories_msg": "Jako součást našeho poslání informovat a inspirovat další dobrovolníky, aby přišli pomoci, plánujeme přidat sociální kanály pro odvážné dobrovolníky a obyvatele, aby se podělili o své neuvěřitelné příběhy se zbytkem světa. Chceme vybudovat tyto nástroje nativně v rámci žádosti o zvýšení příležitostí zachytit inspirující momenty a jak k nim dochází.",
      "photo_recon": "Rozeznávání fotografií",
      "photo_recon_msg1": "Není nic horšího, než když posádka mladých zelenáčů dorazí k jednomu z nich ...",
      "photo_recon_msg2": "... a posádka plná starých profesionálních mazáků je poslána k tomu.",
      "photo_recon_msg3": "Akční průzkum ušetří stovky promarněných dobrovolnických hodin. Naším záměrem je poskytovat co nejvíce možností, jak je to možné pro každého, kdo v systému nahrává a ukládá fotky a informace na staveništi pro budoucí posádky s ním pracovat. dokonce plánujeme mít možnost SMS, nebo pro přeživší aby mohli nahrát fotky a osobní poznámky.",
      "online_training": "Online Výukové Centrum",
      "online_training_msg": "Když celá komunita zareaguje po katastrofě, mnozí postrádají základní výcvik. Chceme přidat sadu krátkých cílených tréninkových videí o tom, jak co nejefektivněji využívat systém. Chceme také umožňují partnerům bezpečně uložit výuková videa pro dobrovolníky a veřejností. Pomocí této jednoduché knihovny, můžeme zlepšit bezpečnost a efektivitu dobrovolníků po celé zemi.",
      "communications_improvements": "Vylepšení Infrastruktury, komunikace, vzájemného propojení ",
      "communications_improvements_msg": "Máme v plánu zavést mnoho dalších vylepšení našich schopností aby mohly sloužit desítkám tisíc dobrovolníků, kteří se spoléhají na Crisis Cleanup každý rok. Tyto zahrnují:",
      "communications_improvements_li1": "Offline schopnosti",
      "communications_improvements_li2": "Vylepšení zabezpečovacího systému",
      "communications_improvements_li3": "Rychlejší načítání map",
      "communications_improvements_li4": "Modularizovat platformu pro bezproblémovou integraci s aplikacemi",
      "communications_improvements_li5": "Veřejné API pro integraci třetích stran",
      "communications_improvements_li6": "Vylepšování výkonu systému",
      "communications_improvements_li7": "Mobilní aplikace pro práci offline",
      "communications_improvements_li8": "Vylepšování administrativních schopností",
      "communications_improvements_li9": "Lepší analýza využití pro cílené zlepšování systému",
      "communications_improvements_li10": "Zlepšené mechanismy zpětné vazby od uživatelů",
      "communications_improvements_li11": "...a více."
    },
