      "def_service": "<Strong> Servis: </strong> znamená, že všechny současné i budoucí služby poskytované na webových stránkách, jak je popsáno v tomto textu nebo jsou jinak nabízeny na webových stránkách, nebo prostřednictvím jiného média, jako je například aplikačního programového rozhraní ( „API“), aplikace  mobilního telefonu; včetně, ale bez omezení pracovního pořádku, průzkumu a mapování poškození a nástroje na pomoc čištění a obnově po krizové události.",
