      "comply_privacy_policy": "<Strong> 4.1.2 </strong> musí být v souladu se Zásadami soukromí a bezpečnostní stanovené v <a href=\"http://www.CrisisCleanup.org/privacy\"> http://www.CrisisCleanup.org/privacy </a>, ve znění občasných změn  ze strany společnosti;",
