      "accept_tc_updates": "přijímáte nejaktuálnější verzi těchto Podmínek a dalších dokumentů uvedených v tomto dokumentu. Společnost může na základě vlastního uvážení čas od času revidovat nebo změnit tyto podmínky zveřejněním revidovaných podmínek na internetových stránkách. Přestože společnost bude usilovat o to, upozornit vás o veškerých zásadních změnách těchto Podmínek, zda bychom upozornit na vás, budete vázáni revidovanými podmínkami pro všechny následné využití služby po učinění takové úpravy. Je tedy na vás, abyste přezkoumali nejaktuálnější verzi Podmínek. V důsledku toho při každém použití webových stránek byste měli zkontrolovat datum těchto Podmínek (která se objeví na konci tohoto dokumentu) a posuzovat veškeré změny od posledního použitého místa. Pokud nesouhlasíte s některou z Podmínek zde uvedenými, neměli byste používat tuto službu.",
