      "apache_license": "<a href=\"https://github.com/CrisisCleanup/\"> open source </a> část Crisis Cleanup  základního kódu je uvolněn pod <a href = \"http://www.apache.org/ licence / licence 2.0.html \"> Apache License, verze 2.0 </a>.",
      "representations_warranties": "Prohlášení a záruky; Vyloučení odpovědnosti",
