      "indemnification": "Odškodnění",
      "by_you": "<Strong> vy. </Strong> Souhlasíte s tím, odškodnit, chránit a bránit společnost a její ředitele, zaměstnancům, dodavatelům, nástupci a nabyvatelé, před veškerými nároky, škody, závazky, ztráty, pasiva, náklady, dluhy nebo výdaje (včetně ale nejen poplatků za právní zastoupení a soudních výloh), které vzniknou z: (i) vašeho používání služeb a přístupu k webovým stránkám; (Ii) vaše porušení některého z těchto Podmínek; (Iii) porušení vámi, nebo kohokoliv, kdo používá vaše materiály, jakéhokoli práva třetí strany, včetně a bez omezení autorského práva, majetek, nebo soukromí správné; (Iv) podvod či uvedení v omyl vámi; (Iv) jakýkoliv nárok vyplývající z pomoci vaší organizace na klienta, nebo (v) jakýmkoli tvrzením, že vaše užívání služby způsobil škodu třetí osobě. Tato obrana a povinnost odškodnění platí i tyto podmínky a vaše používání služeb a internetových stránek.",
